import Staff from '../Staff/Staff'
import './Feed.css'
import SearchBlock from "../SearchBlock/SearchBlock";
import {useState} from "react";

export default function Feed() {
  return (
    <div className='feed'>
      <div>
          <h4 className='h1'>Сервис находиться в тестовом режиме  ➜ <a className="a4" href="https://wiki.corp.dev.vtb/pages/viewpage.action?pageId=3667213012" target="_blank">Нашли ошибку? Пиши в комментариях!</a></h4>
      </div>
      <div className="feedWrapper">
        <Staff user={"user"} dep={"depppp"} func={(xz)=>{console.log(xz)}}/>
      </div>
    </div>
  )
}
